import React from "react";
import aboutPhilData from "../../data/aboutPhilData";
import ContentTemplate from "../ContentTemplate";
import HomePageBanners from "../HomePageBanners";

function AboutPhil() {
  return (
    <div>
      <ContentTemplate
        header={aboutPhilData.header}
        description={aboutPhilData.description}
        img={aboutPhilData.img}
        img2={aboutPhilData.img2}
      />

      <div className="home-divider">
        <div className="row">
          <div className="column">
            <HomePageBanners
              // color={aboutPhilData.color}
              imageDescription={aboutPhilData.imageDescription}
              image={aboutPhilData.img}
            />
          </div>
          <div className="column">
            <div className="book-session-div">
            <HomePageBanners

              image2Description={aboutPhilData.imageDescription2}
              image2={aboutPhilData.img2}
            />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default AboutPhil;
